import { createReducer, on } from '@ngrx/store';
import { ResponseAction } from 'src/app/store/actions/error.actions';
import { initialResponseState } from 'src/app/store/state/app.state';

const _responseReducer = createReducer(initialResponseState, on(ResponseAction, (state, action) => {
  return Object.assign(Object.assign({}, state), {
    responseData: action.responseData
  });
}));

export function responseReducer(state, action) {
  return _responseReducer(state, action);
}
